package com.cloud.sbjm.onput;import java.io.Serializable;import org.hibernate.validator.constraints.NotBlank;public class BaseRequest implements Serializable {    private static final long serialVersionUID = 1279508860383132568L;    @NotBlank(message = "seq is not seq")    private String seq;    @NotBlank(message = "versionNo is not seq")    private String versionNo = "1.0";    @NotBlank(message = "clientType is not seq")    private String clientType;    public BaseRequest() {    }    public BaseRequest(String seq, String versionNo, String clientType) {        this.seq = seq;        this.versionNo = versionNo;        this.clientType = clientType;    }    public String getSeq() {        return seq;    }    public void setSeq(String seq) {        this.seq = seq;    }}